import React from 'react';
import Post from "../post/Post";
import "./posts.css";

export default function Posts({posts}) {
  return (
    <div className="posts">
      <h1>Published Posts</h1>
      {
      posts.map(p=>(
        p.published == true?
        <Post key={p._id} post={p}/>: null
      ))
      }
    </div>
  );
}
